In JSON. [ { "directory":"system", "fileName":"system.log", "toNodes": ["node2"], "method":"cliCommand", "methodArgs": ["bash","-c","rm -rf ./data & systemctl restart ctrl"], "replyMethod":"fileAppend", "ACKTimeout":30, "retries":1, "methodTimeout": 30 }
] In YAML. ---
- toNodes: - node2 method: cliCommand methodArgs: - "bash" - "-c" - | rm -rf ./data & systemctl restart ctrl replyMethod: fileAppend ACKTimeout: 30 retries: 1 ACKTimeout: 30 directory: system fileName: system.log Will send a message to node2 to delete the ctrl data folder, and then restart ctrl. The end result will be appended to the specified file on the node where the request originated.

