For this example we use docker compose to start the NATS server. On your local computer create a folder to hold the NATS docker compose, and configuration files. mkdir nats && cd nats create the docker compose file called nats.yaml, with the following content. version: "3" services: nats: build: . image: nats:latest # -js enables jetstram on the nats server. command: "-c /app/nats-server.conf -D -js" restart: always ports: - "4222:4222" volumes: - ./nats.conf:/app/nats-server.conf logging: driver: "json-file" options: max-size: "10m" max-file: "10" In the same directory create the nats-server.conf file, with the following content. Replace the placeholders for the user keys in the acl with the user keys you created earlier. port: 4222 ACL = { publish: { allow: [">"] } subscribe: { allow: [">"] }
} authorization: { timeout: "30s" users = [ { # github nkey: <REPLACE WITH github user key here> permissions: $ACL }, { # node1 nkey: <REPLACE WITH seed user key here> permissions: $ACL }, ]
}
